import { Link } from 'react-router-dom';
import styles from '../FormularioLogin/FormularioLogin.module.css';

function FormularioCPF() {
    return (
        <div className={styles.div_formulario_login}>
            <p className={styles.bem_vindo}>Crie sua conta</p>

            <p className={styles.sub_titulo}>
                Digite seus dados pessoais para ter acesso à todas as ofertas e promoções
            </p>

            <form>
                <label className={styles.label}>E-mail </label>
                <input className={styles.input} type="email" name="email" placeholder="Digite seu e-mail" />

                <label className={styles.label}>Senha </label>
                <input className={styles.input} type="password" name="senha" placeholder="Digite sua senha" />

                <button className={styles.button}>Entrar</button>
            </form>

            <p className={styles.sem_conta}>Não possui uma conta? <Link to="/">Cadastre-se</Link></p>
            <p className={styles.sem_conta}>É pessoa jurídica? <Link to="/">Clique aqui</Link></p>

        </div>
    );
}

export default FormularioCPF;
